.ucase {
  text-transform: uppercase;
}
.fpanel {
  padding: 60px 0 95px;
}
.fpanel .h-section {
  margin: 0 0 55px;
}
.heading {
  margin: 0 0 15px;
  letter-spacing: 2px;
}
.subheading {
  margin: 0 0 10px;
}
.lspace {
  letter-spacing: 2px;
}
.fullsize {
  width: 100%;
}
.f-large {
  font-size: 15px;
}
.icon-circle {
  display: inline-block;
  width: 27px;
  height: 27px;
  text-align: center;
  line-height: 26px;
  border: 1px solid #bbb;
  color: #bbb;
  font-size: 14px;
  font-family: Arial, sans-serif;
  letter-spacing: 0;
  border-top-right-radius: 27px;
  border-top-left-radius: 27px;
  border-bottom-right-radius: 27px;
  border-bottom-left-radius: 27px;
}
.icon-circle .fa {
  line-height: normal;
}
.page-header {
  margin: 0;
  border-color: #cecece;
}
.page-header .heading {
  font-size: 40px;
}
/* Form */
.cform .form-control {
  height: 36px;
  border-radius: 3px;
  color: {{ settings.color_banner_text }};
}
.cform .form-control:focus {
  -webkit-box-shadow: none;
  box-shadow: none;
}
.cform .form-control.input-lg {
  height: 49px;
}
.cform .checkbox {
  line-height: 120%;
}
/* Buttons */
.btn {
  padding: 12px 20px;
  font-size: 14px;
  border-radius: 4px;
  border-width: 2px;
  border-style: solid;
  background: none;
  text-transform: uppercase;
  letter-spacing: 2px;
  transition: all 0.15s ease-in-out 0s;
}
.btn.btn-small {
  padding: 6px 15px;
  font-size: 12px;
}
.invert {
  color: #fff;
}
.invert .btn {
  border-color: #fff;
  color: #fff;
}
.invert .heading,
.invert .subheading,
.invert a {
  color: #fff !important;
}
/* Up to portrait tablet */
@media (max-width: 767px) {
  .mb-15 {
    margin-bottom: 15px;
  }
}
html,
body {
  overflow-x: hidden;
  /* Prevent scroll on narrow devices */
}
strong {
  font-weight: normal;
}
a {
  transition: all 0.15s ease-in-out 0s;
}
p {
  margin-bottom: 15px;
}
h1 {
  font-size: 60px;
}
h2 {
  font-size: 32px;
}
h3 {
  font-size: 16px;
}
h4 {
  font-size: 15px;
}
h5 {
  font-size: 12px;
}
h1,
h2 {
  letter-spacing: 3px;
}
h3,
h4 {
  letter-spacing: 1px;
}
.sheader .navigation {
  padding: 20px 0 10px;
  font-size: 12px;
}
.sheader .navigation:before,
.sheader .navigation:after {
  content: " ";
  display: table;
}
.sheader .navigation:after {
  clear: both;
}
.sheader .navigation:before,
.sheader .navigation:after {
  content: " ";
  display: table;
}
.sheader .navigation:after {
  clear: both;
}
.sheader .navigation .link-cart {
